import React from "react";
import { NavLink, Route, BrowserRouter as Router, Routes } from "react-router-dom";
import InsertComponent from "./InsertComponent";
import ReadComponent from "./ReadComponent";
import UpdateComponent from "./UpdateComponent";
import DeleteComponent from "./DeleteComponent";
export default class IndexComponent extends React.Component {
    render() {
        return (
            <div className="nav nav-pills">
                <Router>
                    <div className="nav-item">
                        <NavLink className='nav-link' to='/create'>Create</NavLink>
                    </div>
                    <div className="nav-item">
                        <NavLink className='nav-link' to='/read'>Read</NavLink>
                    </div>
                    <div className="nav-item">
                        <NavLink className='nav-link' to='/update'>Update</NavLink>
                    </div>
                    <div className="nav-item">
                        <NavLink className='nav-link' to='/delete'>Delete</NavLink>
                    </div>
                    <Routes>
                        <Route path="/create" element={<InsertComponent />}></Route>
                        <Route path="/read" element={<ReadComponent />}></Route>
                        <Route path="/update" element={<UpdateComponent />}></Route>
                        <Route path="/delete" element={<DeleteComponent />}></Route>
                    </Routes>
                </Router>
            </div>
        )
    }
}
